import {Container, Switch} from "@material-ui/core";
import React from "react";
import { Link, NavLink, Route } from "react-router-dom";
import styles from "./style";
import './Dashboard.css';

import BuyerFollwer from "../component/follower/Follower";
import BuyerProduct from "../component/product/Product";
import BuyerCart from "../component/cart/Cart";
import BuyerOrder from "../component/order/Order";

export default function BuyerDashboard() {
  const classes = styles();
  return (
    <div>
      <div>

      <nav>
        <Link to="/buyer/component/follower">Follower</Link>
        <Link to="/buyer/component/product">Product</Link>
        <Link to="/buyer/component/cart">Cart</Link>
        <Link to="/buyer/component/order">Order</Link>
      </nav>
      <hr></hr>
{/*         
        <ul>
          <li><NavLink to="/buyer/component/follower">Follower</NavLink></li>
          <li><NavLink to="/buyer/component/product">Product</NavLink></li>
          <li><NavLink to="/buyer/component/cart">Cart</NavLink></li>
          <li><NavLink to="/buyer/component/order">Order</NavLink></li>
        </ul>
      </div>
      
      <div> */}
        <Switch>
          <Route exact path="/buyer/component/follower" component={BuyerFollwer} isPrivate />
          <Route exact path="/buyer/component/product" component={BuyerProduct} isPrivate />
          <Route exact path="/buyer/component/cart" component={BuyerCart} isPrivate />
          <Route exact path="/buyer/component/order" component={BuyerOrder} isPrivate />
        </Switch>
      </div>
    </div>
  );
}
